def parse_data_string(data_string):
    # Splitting the string by semicolons
    data_list = [x.strip().split(': ')[1] for x in data_string.split(';') if x]

    # Converting the list of strings to a list of [longitude, latitude] pairs
    data = [[float(data_list[i]), float(data_list[i+1])] for i in range(0, len(data_list), 2)]

    return data


